import Aside from '../elements/Aside';

const LayoutStyle = {
    margin: 20,
    padding: 20,
}

const Layout = (props) => {
    return (
        <div style={LayoutStyle}>
            <Aside />
            <main>
                { props.children }
            </main>
        </div>
    );
}

export default Layout;
